Why was he found with his hands tied behind his back, and the noose
around his neck and private parts, how was that an accident?

In a message dated 6/5/2009 6:55:51 P.M. Eastern Daylight Time,
april@abercrombiegh ostresearch. com writes:

It wasn&#39;t suicide, it was accidental:
Carradine Death Was Accidental

IMDb, June 4, 2009

David Carradine died during a sex game that went wrong, according to
sources in Bangkok, Thailand, where he was found dead on Thursday.

Carradine&#39;s body was discovered in a hotel suite and local reports
suggested he committed suicide. 

He was discovered by a maid, naked and hanged, but the suggestions his
death had a sexual twist were strongly disputed by the star&#39;s close
friend, attorney Vicki Roberts, and his manager Chuck Binder, who
insisted he died of natural causes. 

But a statement from Carradine&#39;s representative now indicates the actor
died during a sex act.

The spokesperson tells TMZ.com, &quot;We can confirm 100 percent that he
never would have committed suicide. It was an accidental death.
Everybody is in shock.&quot; 

Rumours Carradine died attempting auto-erotic asphyxiation- -where
victims achieve heightened sexual pleasure by restricting their air
supply are backed up by a quote a Bangkok police officer gave to British
newspaper The Sun. 

The cop tells reporters, &quot;A rope was attached to his neck and also to
his penis&quot;. 

Rocker Michael Hutchence was rumoured to have died attempting the same
sex act in a Sydney, Australia, hotel room back in 1997--although his
death was officially declared a suicide.

Carradine was in Thailand to shoot the movie &quot;Stretch.&quot; He was 72.
